import React from 'react';
import RainfallGrid from './grid';
import styled from 'styled-components';

const AppContainer = styled.div`
  text-align: center;
  background-color: #282c34;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  font-size: calc(10px + 2vmin);
  color: white;
`;

const AppHeader = styled.header`
  font-size: 2rem;
  margin-bottom: 20px;
`;

function App() {
  return (
    <AppContainer>
      <AppHeader>Rainfall Pattern Grid</AppHeader>
      <RainfallGrid />
    </AppContainer>
  );
}

export default App;
